import React, { Component } from 'react';
import './slideImagens.css';
import Slider from "react-slick";
import Client1 from "../../images/client1.jpg"


export default class SlideImagens extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 4,
      slidesToScroll: 1
    };
    return (
      <div className="container-slider">
        <div className="slider-imagens">
          <Slider {...settings}>
            <div className="slider-imagens-tamanho">
              <img src={Client1} />
              <img src={Client1} />
              <img src={Client1} />
              <img src={Client1} />
              <img src={Client1} />
              <img src={Client1} />
            </div>
          </Slider>
        </div>
      </div>
    );
  }
}
